const toggleSvg = `<svg width="50" height="20" viewBox="0 0 101 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<g style="mix-blend-mode:multiply">
<rect width="101" height="50" fill="url(#pattern0)"/>
</g>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0" transform="translate(0 -0.113006) scale(0.00289017 0.00583815)"/>
</pattern>
<image id="image0" width="346" height="210" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`;

export class ToggleSvg extends React.Component {
    render() {
        return (
            <View>
                <SvgXml xml={toggleSvg} />
            </View>
        );
    }
}


export default function ExamContainer({ navigation }) {
    const [visible, setVisible] = useState(false);
    const [menuExpanded, setMenuExpanded] = useState(false);
    
    const toggleOverlay = () => {
        setMenuExpanded(false);
        setVisible(!visible);
    };


    const toggleMenu = () => {
        setVisible(false);
        setMenuExpanded(!menuExpanded);
    };

    
    const appContext = useContext(AppContext);
    const dispatch = useDispatch();

    const [show, setShow] = useState(false);
    const [showTime, setShowTime] = useState(true);
    const [currentSubject, setCurrentSubject] = useState({});
    const [endExam, setEndExam] = useState(false);
    const [questionImages, setQuestionImages] = useState([]);
    const [currentExamModal, setCurrentExamModal] = useState();
    const [currentQuestionId, setCurrentQuestionId] = useState(1);
    const [currentuestionStartTime, setCurrentuestionStartTime] = useState();
    const [examView, setExamView] = useState('questionView');

    const ongoingExam = _.isEmpty(appContext.userDetails.userId) ? "" : appContext.userDetails.ongoingExam

    const { userId } = _.isEmpty(appContext.userDetails.userId) ? "" : appContext.userDetails;
    const { examId, shuffle, answerCount, examDesc } = ongoingExam;
    const quesImages = [];
    
    if (isExamTimeWithin15Mins(appContext.userDetails.ongoingExam)) {
        // history.push("/timer");
    }

    // Fetching exam details on load
    const examDetails = useGetDataOnLoad(fetchExamQuestionsByExamId, {examId, shuffle}, "examquestions");

    const updatedQuestions = useSelector(state => state.examquestions.questions)

    
    // Event Handlers Begin
    const onNextModal = (modalAction) => {

        // if(modalAction === 'EXIT') {
        //     setCurrentExamModal(<ExitExamModal handleClose={handleClose} onNextModal={onNextModal}/>)
        // }
        if(modalAction === 'DONE') {
            dispatch(saveExamAnswersByUserId({examId, userId}));
            dispatch(updateExamStatusForUser({userId, examId, status: "COMPLETED"}))
            if (examDetails.status === 'succeeded') {
                navigation.navigate('Congratulations');
            }
        }
    }

    const setCurrentQuestion = (questionId, duration) => {
        const subjectDesc = _.isEmpty(currentSubject) ? examDetails.questions.questions[0].subjectDesc : currentSubject.subjectDesc;
        dispatch(updateQuestionWithDuration({questionId: currentQuestionId, duration, subjectDesc}))
        setCurrentQuestionId(questionId)
    }

    const handleClose = () => setShow(false);
    // const openModal = (modalState) => {setShow(modalState); setCurrentExamModal(<PreExitExamModal handleClose={handleClose} onNextModal={onNextModal} />)}
    const onToggleTimer = (isTimerHidden) => setShowTime(!isTimerHidden);
    

    const onSubject = (subject) => {
        setCurrentSubject({subjectDesc: subject.subjectDesc, displayName: subject.displayName, questions: subject.questions});
        const quesImages = [];
        subject.questions.forEach(ques => quesImages.push({imageUrl: ques.imageUrl, questionId: ques.questionId}))
        setQuestionImages(quesImages)
        setCurrentQuestionId(1)
    }

    const onAnswerSelection = (answer, questionId, subjectDesc) => {
        dispatch(updateQuestionWithAnswer({questionId, answer, subjectDesc}))
    }

    const onQuestionNumber = (questionId) => {
        setCurrentQuestionId(questionId)
    }

    const onFlaggingQuestion = (flagged, questionId) => {
        const examQuestions = examDetails.questions.questions;
        const subjectDesc = _.isEmpty(currentSubject) ? examQuestions[0].subjectDesc : currentSubject.subjectDesc;
        setMenuExpanded(false);
        dispatch(flagQuestion({flagged, questionId, subjectDesc}))
    }

    
    // Update Everytime user click on the answer
    useEffect(() => {
        const currSubject = Object.assign({}, currentSubject);
        if (updatedQuestions?.questions) {
            updatedQuestions.questions.forEach(updatedQuestion => {
                if(updatedQuestion.subjectDesc === currSubject.subjectDesc) {
                    currSubject.questions = updatedQuestion.questions
                }
            });
        }
        setCurrentSubject(currSubject)
    }, [updatedQuestions]);

    useEffect(() => {
        setCurrentuestionStartTime(getCurrentTime());
    }, [quesImages]);

    const onNextClick = (value) => {
        setExamView(value);
    }

    const onPrevClick = (value) => {
        setExamView(value);
    }

    if (examDetails.status === 'loading' && examView === 'questionView') {
        return  <Text>Loading...</Text>
    
    } else if (examDetails.status === 'succeeded' && examDetails.questions.questions.length > 0 && (examView === 'questionView' || examView === 'EndOfExamIntimation' || examView === 'EndOfExamInfo')) {
        const examQuestions = examDetails.questions.questions;

        examQuestions[0].questions.forEach((ques) => quesImages.push({imageUrl: ques.imageUrl, questionId: ques.questionId}))

        const currentSub = _.isEmpty(currentSubject) ? {subjectDesc: examQuestions[0].subjectDesc, displayName: examQuestions[0].displayName, questions: examQuestions[0].questions} : currentSubject;
        const qImages = _.isEmpty(questionImages) ? quesImages : questionImages;
        const remainingTime = getRemainingTime(ongoingExam);
    
        const onNextQuestion = () => {
           
           // increases index by 1
           const currentIndex = ((currentQuestionId) >=  (quesImages.length) ? 1 : (currentQuestionId + 1));
           console.log("currentIndex ", currentIndex)
           const duration = getTimeDiffInSeconds(currentuestionStartTime);
           setCurrentQuestion(currentIndex, duration)
           setCurrentuestionStartTime(getCurrentTime());
        //    setClearLines(true)
        }
    
        const onPrevQuestion = () => {
            const currentIndex = currentQuestionId === 1 ? (quesImages.length) : currentQuestionId - 1;
            if (currentIndex >= 0) {
                const duration = getTimeDiffInSeconds(currentuestionStartTime);
                setCurrentQuestion(currentIndex, duration)
                setCurrentuestionStartTime(getCurrentTime());
                // setClearLines(true)
            }
        }

        return (
            <View style={styles.examWrapper}>
                <ExamScreen>
                    <View style={styles.header}>
                    {
                        examView === 'questionView' 
                        ? 
                        <Text><SvgXml style={showTime ? styles.examIntimationToggleOn : styles.examIntimationToggleOff} xml={toggleSvg} onPress={() => onToggleTimer(showTime)}/> <Text>TIME TO END THE EXAM</Text></Text> 
                        : <Text></Text>
                    }
                        <View style={styles.alternativeLayoutButtonContainer}>
                            <Text>
                                <ExamTimer ongoingExam={ongoingExam} onToggleTimer={onToggleTimer} showTimer={showTime} examView={examView} />
                            </Text>
                            {examView === 'questionView' 
                                ? <TouchableOpacity style={[styles.submitbutton, styles.endExamBtn]} onPress={() => setExamView('EndOfExamIntimation')}>
                                        <Text style={[styles.buttontext, styles.endExamBtnText]}>END THE EXAM</Text>
                                </TouchableOpacity> 
                                : <Text></Text>}
                        </View>
                        { examView === 'questionView' ?  <QuestionView 
                            quesImages={quesImages} 
                            qImages={qImages} 
                            currentQuestionId={currentQuestionId} 
                            toggleMenu={toggleMenu} 
                            toggleOverlay={toggleOverlay} 
                            currentSub={currentSub} 
                            examDesc={examDesc} 
                            answerCount={answerCount} 
                            menuExpanded={menuExpanded} 
                            examQuestions={examQuestions} 
                            onSubject={onSubject} 
                            onAnswerSelection={onAnswerSelection} 
                            onQuestionNumber={onQuestionNumber} 
                            onPrevQuestion={onPrevQuestion} 
                            onNextQuestion={onNextQuestion} 
                            onFlaggingQuestion={onFlaggingQuestion} 
                            visible={visible} 
                        /> :
                        examView === 'EndOfExamIntimation' ? <EndOfExamIntimation navigation={navigation} subjects={examQuestions} onNextClick={onNextClick} onPrevClick={onPrevClick} />
                        :
                        <EndOfExamInfo navigation={navigation} subjects={examQuestions} onPrevClick={onPrevClick} onNextModal={onNextModal}/>}
                    </View>
                </ExamScreen>
                 
            </View>
        );
    } else if (examView === 'EndOfExamIntimation' && examDetails.questions.questions.length > 0) {
        const examQuestions = examDetails.questions.questions;
        const examIntimation = [<EndOfExamIntimation navigation={navigation} subjects={examQuestions} onNextClick={onNextClick} onPrevClick={onPrevClick} />];
        return examIntimation;
    } else if (examView === 'EndOfExamInfo' && examDetails.questions.questions.length > 0) {
        const examQuestions = examDetails.questions.questions;
        const examIntimation = [<EndOfExamInfo navigation={navigation} subjects={examQuestions} onPrevClick={onPrevClick} onNextModal={onNextModal}/>];
        return examIntimation;
    } else {
        const message = 'Exam Content is not Available';
        return <View><NoExam message={message} /></View>;
    }
}

